DROP TABLE IF EXISTS `currency`;

CREATE TABLE `currency` (
  `id` INT NOT NULL,
  `code` VARCHAR(16) NULL,
  `name` VARCHAR(255) NULL,
  `unit` TINYINT NULL,
  `country_id` INT NULL,
  `country_name` VARCHAR(255) NULL,
  PRIMARY KEY (`id`),
  INDEX `idx_code` (`code` ASC),
  INDEX `idx_name` (`name` ASC),
  INDEX `idx_country` (`country_id` ASC)
);

LOCK TABLES `currency` WRITE;
/*!40000 ALTER TABLE `currency` DISABLE KEYS */;
/*!40000 ALTER TABLE `currency` ENABLE KEYS */;
UNLOCK TABLES;

CREATE TABLE `currency_crypto` (
    `id` INT NOT NULL,
    `code` VARCHAR(16) NULL,
    `name` VARCHAR(255) NOT NULL,
    `logo` VARCHAR(255) NOT NULL,
    `explorer` VARCHAR(1024) NULL,
    `site` VARCHAR(1024) NULL,
    `chat` VARCHAR(1024) NULL,
    `announcement` VARCHAR(1024) NULL,
    `confirmations` INT NULL,
    `supply` DECIMAL(36,18) NULL,
    `source_code` VARCHAR(255) NULL,
    `documentation` VARCHAR(255) NULL,
    `type` ENUM('coin', 'token') NULL,
    `is_mineable` TINYINT(1) NULL,
    PRIMARY KEY (`id`),
    UNIQUE INDEX `code_UNIQUE` (`code` ASC)
);

LOCK TABLES `currency_crypto` WRITE;
/*!40000 ALTER TABLE `currency_crypto` DISABLE KEYS */;
/*!40000 ALTER TABLE `currency_crypto` ENABLE KEYS */;
UNLOCK TABLES;